import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <h1 style={{color: '#3de9cf',fontSize:'70px',marginTop:'20px',marginLeft:'20px'}}>MOP&lt;E</h1>
      <h1 style={{color: '#ffffffff',fontSize:'30px',marginTop:'-60px',marginLeft:'25px'}}>모플</h1>

      <div style={{display:'flex',justifyContent:'center'}}>
        <h1 style={{color: '#3de9cf',fontSize:'50px'}}>ACHIEVE</h1>
        <h1 style={{color: '#ffffffff',fontSize:'50x'}}>INNOVATION</h1>
      </div>

      <div style={{display:'flex',justifyContent:'center'}}>
        <h1 style={{color: '#ffffffff',fontSize:'30px'}}>혁신을</h1>
        <h1 style={{color: '#3de9cf',fontSize:'30px',marginLeft:'10px'}}>만들다</h1>
      </div>
    </div>
  );
}

export default App;
